0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"https://wpml.org/?p=1351040\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:372:\"We are happy to announce our latest integration with Geacom GmbH, a technical translation service. With sixteen years of experience in the market and branches in Germany, Russia, and Estonia, Geacom offers all language pairs to WPML users. Geacom specializes in highly complex technical translations for medium and large businesses, by providing its clients with [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Ornela Flores\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2740:\"<h4>We are happy to announce our latest integration with <a href=\"https://geacom.eu/en/\">Geacom GmbH</a>, a technical translation service.<a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/08/Geacomwpml.png\"><img class=\"aligncenter wp-image-1351066\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/08/Geacomwpml-300x170.png\" alt=\"\" width=\"299\" height=\"170\" srcset=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/08/Geacomwpml-300x170.png 300w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/08/Geacomwpml-150x85.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/08/Geacomwpml.png 388w\" sizes=\"(max-width: 299px) 100vw, 299px\" /></a></h4>\n<p>With sixteen years of experience in the market and branches in Germany, Russia, and Estonia, Geacom offers all language pairs to WPML users.</p>\n<p>Geacom specializes in highly complex technical translations for medium and large businesses, by providing its clients with professional field-specific translations of all kinds: manuals, instructions, data sheets, technical catalogs, and product catalogs, among others.</p>\n<p>They aim to promote your business in every aspect and are capable of handling marketing and legal documentations such as patents, contracts, financial reports, etc. Always stored in encrypted form and protected against unauthorized access.</p>\n<p>Geacom’s projects managers are available 24/7 to ensure that they find the best and most economical option for you.</p>\n<p>The combination of linguistic and technical expertise provided by Geacom makes it a suitable and convenient solution for translating your WordPress site.</p>\n<p>If you are already a WPML user and want to use Geacom GmbH for translation, follow the instructions for<a href=\"https://wpml.org/translation-service/geacom-gmbh/\"> translating WordPress sites with Geacom GmbH</a>. If you are new to WPML, feel free to purchase the<a href=\"https://wpml.org/purchase/\"> Multilingual CMS</a> package to get started.</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=UdWjwh--nJo:XcOb8kgLZS0:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=UdWjwh--nJo:XcOb8kgLZS0:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=UdWjwh--nJo:XcOb8kgLZS0:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=UdWjwh--nJo:XcOb8kgLZS0:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=UdWjwh--nJo:XcOb8kgLZS0:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=UdWjwh--nJo:XcOb8kgLZS0:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/UdWjwh--nJo\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"https://wpml.org/2017/08/wpml-welcomes-geacom-gmbh-as-new-translation-partner/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"https://wpml.org/2017/08/wpml-welcomes-geacom-gmbh-as-new-translation-partner/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"We’re Delaying WPML 3.8 Until After the Summer Holidays\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpml/~3/4m5PPk5Z7I4/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"https://wpml.org/2017/08/were-delaying-wpml-3-8-until-after-the-summer-holidays/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 24 Aug 2017 18:03:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"WPML versions\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"https://wpml.org/?p=1350410\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:295:\"WPML 3.8 is ready for public release (has been ready for over a week now), but we&#8217;re holding it back for a little while longer. The end of August is vacation time for many and we want to avoid any drama while clients are away and trying to relax. Delaying WPML 3.8 is a difficult [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Amir\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2551:\"<p class=\"lead\">WPML 3.8 is ready for public release (has been ready for over a week now), but we&#8217;re holding it back for a little while longer. The end of August is vacation time for many and we want to avoid any drama while clients are away and trying to relax.</p>\n<p>Delaying WPML 3.8 is a difficult decision for us. This is one of the best releases of WPML so far. We&#8217;ve been running it on our own sites for the last two weeks and the results are wonderful. Most pages on our sites (wpml.org and wp-types.com) load at around 1/2 of the time they used to load before.</p>\n<p>This speed improvement is a result of two major changes. Many of the internal calls in WPML (especially around String Translation) are improved. And, more significant, WPML 3.8 allows us to run without loading .mo files. Our sites, like many other WordPress sites, use plenty of plugins that each loads a translation file. All these translation files build up and take a long time to load. WPML 3.8 loads the right translations for each page, avoiding the need to load all these .mo files with thousands of strings that don&#8217;t display.</p>\n<p>Besides the speed improvements, this version of WPML packs a complete redesign for the <strong>Theme and plugins localization</strong> admin screen. This greatly simplifies usability and adds much-awaited features.</p>\n<p>We&#8217;ll press the Publish button at the first week of September. If you want to switch to WPML 3.8 already, log-in to <a href=\"https://wpml.org/account/\">your account</a>, go to <strong>Downloads</strong>, switch the channel to <strong>Beta</strong> and download.</p>\n<p>Remember to update ALL of WPML&#8217;s components and not only the main plugin. You cannot use the &#8216;production&#8217; version of String Translation (or any other WPML component) with the beta of WPML core.</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=4m5PPk5Z7I4:FlCEpjzxeOw:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=4m5PPk5Z7I4:FlCEpjzxeOw:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=4m5PPk5Z7I4:FlCEpjzxeOw:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=4m5PPk5Z7I4:FlCEpjzxeOw:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=4m5PPk5Z7I4:FlCEpjzxeOw:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=4m5PPk5Z7I4:FlCEpjzxeOw:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/4m5PPk5Z7I4\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"https://wpml.org/2017/08/were-