ase\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"https://wpml.org/?p=1347941\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:376:\"Today we are happy to announce a few WPML compatible WooCommerce extensions. The WooCommerce extensions are: YITH WC Product Bundles, YITH WooCommerce Order Tracking, WooCommerce Wholesale Lead Capture If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here: Multilingual Ready Themes Multilingual Ready Plugins [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Mohamed Khafaja\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4312:\"<p><img class=\"aligncenter wp-image-1119587\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/10/Compatible-woocommerce-extention-header-image.png\" alt=\"compatible-woocommerce-extention-header-image\" width=\"400\" height=\"112\" srcset=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/10/Compatible-woocommerce-extention-header-image.png 568w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/10/Compatible-woocommerce-extention-header-image-150x42.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/10/Compatible-woocommerce-extention-header-image-300x84.png 300w\" sizes=\"(max-width: 400px) 100vw, 400px\" /><br />\nToday we are happy to announce a few WPML compatible WooCommerce extensions.</p>\n<p>The WooCommerce extensions are: <a href=\"https://yithemes.com/themes/plugins/yith-woocommerce-product-bundles\" target=\"_blank\" rel=\"nofollow\">YITH WC Product Bundles</a>, <a href=\"https://yithemes.com/themes/plugins/yith-woocommerce-order-tracking/\" target=\"_blank\" rel=\"nofollow\">YITH WooCommerce Order Tracking</a>, <a href=\"https://wholesalesuiteplugin.com/product/woocommerce-wholesale-lead-capture/\" target=\"_blank\" rel=\"nofollow\">WooCommerce Wholesale Lead Capture</a> </p>\n<p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a href=\"https://wpml.org/documentation/theme-compatibility/\">Multilingual Ready Themes</a></li>\n<li><a href=\"https://wpml.org/documentation/plugins-compatibility/\">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you’re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and are ready to help: You are welcome to contact us at <a href=\"https://wpml.org/documentation/theme-compatibility/go-global-program/\">go global program page</a>.</p>\n<p>In order to expedite the process, we strongly recommend that you test your theme or plugin with our <a href=\"https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/\">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin Multilingual Ready.</p>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">YITH WC Product Bundles</h2>\n<blockquote><p>Bundling products is one of the smartest strategies to increase sales.</p></blockquote>\n<p style=\"text-align: center;\"><a class=\"button download-button vt-p\" href=\"https://yithemes.com/themes/plugins/yith-woocommerce-product-bundles\" target=\"_blank\" rel=\"nofollow\">Purchase YITH WC Product Bundles</a></p>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">YITH WooCommerce Order Tracking</h2>\n<blockquote><p>Offer your users the possibility to check their order tracking status.</p></blockquote>\n<p style=\"text-align: center;\"><a class=\"button download-button vt-p\" href=\"https://yithemes.com/themes/plugins/yith-woocommerce-order-tracking/\" target=\"_blank\" rel=\"nofollow\">Purchase YITH WooCommerce Order Tracking</a></p>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">WooCommerce Wholesale Lead Capture</h2>\n<blockquote><p>Creates all the necessary wholesale registration &#038; login pages plus gives you wholesale signup email sequences and your choice of manual or automated approvals.</p></blockquote>\n<p style=\"text-align: center;\"><a class=\"button download-button vt-p\" href=\"https://wholesalesuiteplugin.com/product/woocommerce-wholesale-lead-capture/\" target=\"_blank\" rel=\"nofollow\">Purchase WooCommerce Wholesale Lead Capture</a></p>\n</div>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=keduizjN2tI:R7cRPUoKLlA:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=keduizjN2tI:R7cRPUoKLlA:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=keduizjN2tI:R7cRPUoKLlA:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=keduizjN2tI:R7cRPUoKLlA:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=keduizjN2tI:R7cRPUoKLlA:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=keduizjN2tI:R7cRPUoKLlA:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/keduizjN2tI\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"https://wpml.org/2017/08/compatible-woocommerce-extensions-aug-2017/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s: