/wpml.org/?p=1345171\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:371:\"We are happy to announce the compatibility of WPML and WP Rocket. This wouldn&#8217;t have been possible without the cooperation of WP Rocket team. WP Rocket is a premium caching plugin for WordPress that allows optimizing your website performance. Besides page caching, CSS/JS minification, and CDN integration, WP Rocket offers many other unique features such [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Mohamed Khafaja\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3061:\"<p><a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/08/WPML-and-WP-Rocket-compatibility.png\"><img src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/08/WPML-and-WP-Rocket-compatibility.png\" alt=\"\" width=\"672\" height=\"200\" class=\"aligncenter size-full wp-image-1345215\" srcset=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/08/WPML-and-WP-Rocket-compatibility.png 672w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/08/WPML-and-WP-Rocket-compatibility-150x45.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/08/WPML-and-WP-Rocket-compatibility-300x89.png 300w\" sizes=\"(max-width: 672px) 100vw, 672px\" /></a><br />\nWe are happy to announce the compatibility of WPML and <a href=\"https://wp-rocket.me/\" target=\"_blank\">WP Rocket</a>. This wouldn&#8217;t have been possible without the cooperation of WP Rocket team. </p>\n<p>WP Rocket is a premium caching plugin for WordPress that allows optimizing your website performance. Besides page caching, CSS/JS minification, and CDN integration, WP Rocket offers many other unique features such as GZIP compression, Lazyload, and tons of other features. </p>\n<p>It is worth mentioning that we are working closely with the WP Rocket team to maintain the compatibility with WPML by resolving any issues that may arise in the future.</p>\n<p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a href=\"https://wpml.org/documentation/theme-compatibility/\">Multilingual Ready Themes</a></li>\n<li><a href=\"https://wpml.org/documentation/plugins-compatibility/\">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you’re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href=\"https://wpml.org/documentation/theme-compatibility/go-global-program/\">go global program page</a>.</p>\n<p>In order to expedite the process, we strongly recommend that you test your theme or plugin with our <a href=\"https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/\">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin Multilingual Ready.</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=uxcjQ_U_UwA:JevnZga_2PA:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=uxcjQ_U_UwA:JevnZga_2PA:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=uxcjQ_U_UwA:JevnZga_2PA:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=uxcjQ_U_UwA:JevnZga_2PA:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=uxcjQ_U_UwA:JevnZga_2PA:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=uxcjQ_U_UwA:JevnZga_2PA:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/uxcjQ_U_UwA\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"https://wpml.org/2017/08/build-fast-multilingual-sites-using-wpml-and-wp-rocket/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://wpml.org/2017/08/build-fast-multilingual-sites-using-wpml-and-wp-rocket/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Compatible Plugins – Aug 2017\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpml/~3/RVfsWPpCzcE/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"https://wpml.org/2017/08/compatible-plugins-aug-2017-2/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\