loudfront.net/wp-content/uploads/2016/08/Compatible-Plugins-Header.png 680w\" sizes=\"(max-width: 400px) 100vw, 400px\" /></p>\n<p>Today we are happy to announce a few WPML compatible plugins.</p>\n<p>The plugins are: <a href=\"https://wordpress.org/plugins/widgets-control/\" target=\"_blank\">Widgets Control</a>, <a href=\"https://wordpress.org/plugins/wp-discussion-board/\" target=\"_blank\">Discussion Board</a></p>\n<p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a href=\"https://wpml.org/documentation/theme-compatibility/\">Multilingual Ready Themes</a></li>\n<li><a href=\"https://wpml.org/documentation/plugins-compatibility/\">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you’re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href=\"https://wpml.org/documentation/theme-compatibility/go-global-program/\">go global program page</a>.</p>\n<p>In order to expedite the process, we strongly recommend that you test your theme or plugin with our <a href=\"https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/\">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin Multilingual Ready.</p>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Widgets Control</h2>\n<blockquote><p>This plugin provides visibility management for widgets and sidebars.</p></blockquote>\n<p style=\"text-align: center;\"><a class=\"button download-button vt-p\" href=\"https://wordpress.org/plugins/widgets-control/\" target=\"_blank\">Download Widgets Control</a></p>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Discussion Board</h2>\n<blockquote><p>Discussion Board is an easy way to add a discussion board, message board or forum to your WordPress site.</p></blockquote>\n<p style=\"text-align: center;\"><a class=\"button download-button vt-p\" href=\"https://wordpress.org/plugins/wp-discussion-board/\" target=\"_blank\">Download Discussion Board</a></p>\n</div>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=RVfsWPpCzcE:sLbeMvkU2MQ:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=RVfsWPpCzcE:sLbeMvkU2MQ:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=RVfsWPpCzcE:sLbeMvkU2MQ:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=RVfsWPpCzcE:sLbeMvkU2MQ:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=RVfsWPpCzcE:sLbeMvkU2MQ:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=RVfsWPpCzcE:sLbeMvkU2MQ:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/RVfsWPpCzcE\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"https://wpml.org/2017/08/compatible-plugins-aug-2017-2/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://wpml.org/2017/08/compatible-plugins-aug-2017-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"Lingo24 joins WPML as new translation partner\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpml/~3/qH5mjgVsc4c/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"https://wpml.org/2017/08/lingo24-joins-wpml-as-new-translation-partner/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 14 Aug 2017 12:49:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"https://wpml.org/?p=1341655\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:425:\"We are happy to announce the recent integration between WPML and Lingo24, a customized translation service. Lingo24 specializes in e-commerce, marketing, product information content, and projects that can benefit from a technology-led translation approach. At Lingo24, they know that one size of translation doesn&#8217;t fit everybody; sometimes clients have critical documentation that requires sensitive checking [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Ornela Flores\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3588:\"<h4>We are happy to announce the recent integration between <a href=\"https://wpml.org/\">WPML</a> and <a href=\"http://www.lingo24.com/us/\">Lingo24</a>, a customized translation service.<br />\n<a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/08/Lingo24wpml.png\"><img class=\"aligncenter size-medium wp-image-1341676\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/08/Lingo24wpml-300x181.png\" alt=\"Lingo24\" width=\"300\" height=\"181\" srcset=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/08/Lingo24wpml-300x181.png 300w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/08/Lingo24wpml-150x91.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/08/Lingo24wpml.png 364w\" sizes=\"(max-width: 300px) 100vw, 300px\" /></a></h4>\n<p>Lingo24 specializes in e-commerce, marketing, product information content, and projects that can benefit from a technology-led translation approach.</p>\n<p>At Lingo24, they know that one size of translation doesn&#8217;t fit everybody; sometimes clients have critical documentation that requires sensitive checking to achieve 100% accuracy. Other times clients might need bulk documentation, where they simply wish to understand the &#8216;gist&#8217; as quickly as possible. Some might require culturally localized material or machine translation for high-volume documentation.</p>\n<p>For the right type of content, Lingo24 can combine Machine Translation capability with expert linguist reviewers to reduce costs and turnaround time while offering consistent quality.</p>\n<blockquote><p><em>&#8220;We’re constantly looking to develop tech which simplifies working in multiple languages and are excited to add WPML to our list of integrations.  We hope that our award-winning technology, varying service levels and global team will give a great option for those looking for the right partner to accelerate their international growth.&#8221;</em></p>\n<p><em>Nick Campbell, Strategic Growth Director at Lingo24</em></p></blockquote>\n<p>Lingo24’s usual clients are companies with large product catalogs that range from global organizations such as Adidas, The Economist, and Virgin, to travel brands such as Rezidor and Accor, as well as fast-growing retailers like SportPursuit and Protein World.</p>\n<p>Its team is spread across multiple time zones—they are on call whatever time of day you need, with over 4,000 native speaking, freelance translators based in the country whose language they translate.</p>\n<p>If you are already a WPML user and interested in using Lingo24 for translation, follow the instructions for<a href=\"https://wpml.org/translation-service/lingo24/\"> translating WordPress sites with Lingo24</a>. If you are new to WPML, feel free to purchase the<a href=\"https://wpml.org/purchase/\"> Multilingual CMS</a> package and get started.</p>\n<p>&nbsp;</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=qH5mjgVsc4c:4TWDCwcmhmk:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=qH5mjgVsc4c:4TWDCwcmhmk:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=qH5mjgVsc4c:4TWDCwcmhmk:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=qH5mjgVsc4c:4TWDCwcmhmk:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=qH5mjgVsc4c:4TWDCwcmhmk:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=qH5mjgVsc4c:4TWDCwcmhmk:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/qH5mjgVsc4c\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellforme