:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"https://wpml.org/?p=1334648/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:360:\"We&#8217;re ready with another, final, beta for WPML 3.8. Like you probably know, in this release we are focused on performance. Since the previous beta we found additional room for improvement and it&#8217;s ready for your testing now. The new defaults for speed and ease-of-use Until now, when you activated WPML&#8217;s String Translation, you had [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Amir\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4987:\"<p class=\"lead\">We&#8217;re ready with another, final, beta for WPML 3.8. Like you probably know, in this release we are focused on performance. Since the previous beta we found additional room for improvement and it&#8217;s ready for your testing now.</p>\n<div class=\"embed-responsive embed-responsive-16by9\"><iframe width=\"525\" height=\"394\" src=\"https://www.youtube.com/embed/QYT5hIfBl6A?feature=oembed\" frameborder=\"0\" allowfullscreen></iframe></div>\n<h2>The new defaults for speed and ease-of-use</h2>\n<p>Until now, when you activated WPML&#8217;s String Translation, you had to configure it. This meant two things:</p>\n<ul>\n<li>Without configuration, translations are not showing.</li>\n<li>You could pick the &#8220;right&#8221; configuration or the &#8220;wrong&#8221; configuration, leading to low performance and harder use.</li>\n</ul>\n<p>Now, when you activate String Translation, WPML automatically sets the best mode for your site. What&#8217;s the best mode? This depends on the actual strings found in your site. If you only have strings that come from English texts, WPML sets it as the site&#8217;s default. WPML will only run String Translation in other languages, so that it doesn&#8217;t slow your site for the default language.</p>\n<p>Bottom line, there&#8217;s less configuration and better performance.</p>\n<p>When you upgrade to WPML 3.8, it will check if your configuration has room for improvement and would suggest to you to automatically make changes when needed.</p>\n<h2>Run String Translation only when it&#8217;s absolutely needed</h2>\n<p>String Translation allows you to translate texts (strings) from one language to others. In WPML 3.8, we&#8217;ve applied several important speed optimizations to this:</p>\n<ul>\n<li>WPML doesn&#8217;t look for translations to the original language.</li>\n<li>WPML doesn&#8217;t check the original language of each string separately.</li>\n<li>WPML only loads the right strings needed for each page.</li>\n</ul>\n<p>Together, this means much faster operation.</p>\n<h2>String Translation instead of .mo files</h2>\n<p>The major new feature in WPML 3.8 is the ability to replace .mo files with String Translation. You probably know that WordPress uses .mo files and that .mo files are relatively efficient (because they&#8217;re running below PHP).</p>\n<p>However, this holds true only for small .mo files. Some plugins (and even WordPress core) have HUGE .mo files. WPML has huge .mo files. WooCommerce has huge .mo files and other plugins and themes also.</p>\n<p>If it takes WPML longer to load the translation of &#8220;a string&#8221;, but it loads a tiny fraction of the strings found in the .mo files, WPML can do the job a lot faster. For example, when you&#8217;re looking at a blog post on the front-end, you need maybe 15 strings from WordPress core (&#8220;leave a reply&#8221;, &#8220;reply&#8221;, etc.). To get these few strings, WordPress loads a HUGE .mo file.</p>\n<p>Now, WPML will block loading this .mo file and, instead, supply the translations for these specific strings. The performance gain is very significant.</p>\n<p>For this little magic to happen, WPML needs a short training period. As soon as you activate the option to &#8220;not load .mo files&#8221;, WPML hooks to the .mo file loading and reads the strings that they contain. We do this in small batches, so as not to load your site too much. When this training is over (typically, after several loads of the site), WPML switches mode, blocks the scanned .mo files and supplies the necessary translations.</p>\n<h2>Give it a try!</h2>\n<p>WPML development team spent months on this version and we&#8217;re eager to know your feedback. We are running full QA next week. If you can test this version on your development sites, we&#8217;ll know for sure that all the new stuff doesn&#8217;t conflict with your code and with plugins and themes that you&#8217;re using.</p>\n<p>To test, go to your <a href=\"https://wpml.org/account/\">WPML account</a> and click on Downloads. Switch the channel to <strong>Beta</strong> and download. Make sure that you&#8217;re downloading all of WPML&#8217;s components that you use (you should not mix &#8220;production&#8221; and &#8220;beta&#8221; components).</p>\n<p>Let us know how it&#8217;s working for you?</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=IR5FF57zqDI:2fkZIiWSab0:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=IR5FF57zqDI:2fkZIiWSab0:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=IR5FF57zqDI:2fkZIiWSab0:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=IR5FF57zqDI:2fkZIiWSab0:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=IR5FF57zqDI:2fkZIiWSab0:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=IR5FF57zqDI:2fkZIiWSab0:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/IR5FF57zqDI\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://wpml.org/2017/08/last-wpml-3-8-beta-with-performance-boost/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"12\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://wpml.org/2017/08/last-wpml-3-8-beta-with-performance-boost/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"WPML Compatible Themes – Aug 2017\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpml/~3/6bWgcT3FOlk/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://wpml.org/2017/08/wpml-compatible-themes-aug-2017/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 08 Aug 2017 11:59:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"Compatibility\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"https://wpml.org/?p=1337439/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:334:\"Today we are happy to announce several WPML compatible themes. The themes are: Motors, Claue, Osteria If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here: Multilingual Ready Themes Multilingual Ready Plugins Also, if you’re a theme or a plugin author and you want [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Mohamed Khafaja\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3848:\"<p><img class=\"aligncenter wp-image-975307\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/07/WPML-Compatible-themes-1-300x84.png\" alt=\"WPML Compatible themes\" width=\"400\" height=\"112\" srcset=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/07/WPML-Compatible-themes-1-300x84.png 300w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/07/WPML-Compatible-themes-1-150x42.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/07/WPML-Compatible-themes-1.png 568w\" sizes=\"(max-width: 400px) 100vw, 400px\" /></p>\n<p>Today we are happy to announce several WPML compatible themes.</p>\n<p>The themes are: <a href=\"https://themeforest.net/item/motors-automotive-cars-vehicle-boat-dealership-classifieds-wordpress-theme/13987211\" target=\"_blank\">Motors</a>, <a href=\"https://themeforest.net/item/claue-clean-minimal-woocommerce-theme/18929281\" target=\"_blank\">Claue</a>, <a href=\"https://themeforest.net/item/osteria-an-engaging-restaurant-wordpress-theme/20011125\" target=\"_blank\">Osteria</a></p>\n<p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a href=\"https://wpml.org/documentation/theme-compatibility/\">Multilingual Ready Themes</a></li>\n<li><a href=\"https://wpml.org/documentation/plugins-compatibility/\">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you’re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href=\"https://wpml.org/documentation/theme-compatibility/go-global-program/\">go global program page</a>.</p>\n<p>In order to expedite the process, we strongly recommend that you test your theme or plugin with our <a href=\"https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/\">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin Multilingual Ready.</p>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Motors</h2>\n<blockquote><p>Automotive, Cars, Vehicle, Boat Dealership, Classifieds WordPress Theme</p></blockquote>\n<p style=\"text-align: center;\"><a class=\"button download-button vt-p\" href=\"https://themeforest.net/item/motors-automotive-cars-vehicle-boat-dealership-classifieds-wordpress-theme/13987211\" target=\"_blank\">Purchase Motors</a></p>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Claue</h2>\n<blockquote><p>A WooCommerce theme for online fashion stores, personal blog.</p></blockquote>\n<p style=\"text-align: center;\"><a class=\"button download-button vt-p\" href=\"https://themeforest.net/item/claue-clean-minimal-woocommerce-theme/18929281\" target=\"_blank\">Purchase Claue</a></p>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Osteria</h2>\n<blockquote><p>Restaurant WordPress theme</p></blockquote>\n<p style=\"text-align: center;\"><a class=\"button download-button vt-p\" href=\"https://themeforest.net/item/osteria-an-engaging-restaurant-wordpress-theme/20011125\" target=\"_blank\">Purchase Osteria</a></p>\n</div>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=6bWgcT3FOlk:xndyO_pVYNw:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=6bWgcT3FOlk:xndyO_pVYNw:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=6bWgcT3FOlk:xndyO_pVYNw:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=6bWgcT3FOlk:xndyO_pVYNw:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=6bWgcT3FOlk:xndyO_pVYNw:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=6bWgcT3FOlk:xndyO_pVYNw:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/6bWgcT3FOlk\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://wpml.org/2017/08/wpml-compatible-themes-aug-2017/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://wpml.org/2017/08/wpml-compatible-themes-aug-2017/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Compatible Plugins – Aug 2017\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpml/~3/WKQilMBdTOI/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"https://wpml.org/2017/08/compatible-plugins-aug-2017/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 01 Aug 2017 11:24:40 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"Compatibility\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"https://wpml.org/?p=1332189/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:345:\"Today we are happy to announce a few WPML compatible plugins. The plugins are: ThreatPress Security, Enhanced Media Library, Duplicate Post If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here: Multilingual Ready Themes Multilingual Ready Plugins Also, if you’re a theme or a [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Mohamed Khafaja\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3943:\"<p><img class=\"aligncenter wp-image-995848\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/08/Compatible-Plugins-Header-300x90.png\" alt=\"Compatible Plugins-Header\" width=\"400\" height=\"121\" srcset=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/08/Compatible-Plugins-Header-300x90.png 300w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/08/Compatible-Plugins-Header-150x45.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/08/Compatible-Plugins-Header.png 680w\" sizes=\"(max-width: 400px) 100vw, 400px\" /></p>\n<p>Today we are happy to announce a few WPML compatible plugins.</p>\n<p>The plugins are: <a href=\"https://wordpress.org/plugins/threatpress-security/\" target=\"_blank\">ThreatPress Security</a>, <a href=\"https://wordpress.org/plugins/enhanced-media-library/\" target=\"_blank\">Enhanced Media Library</a>, <a href=\"https://wordpress.org/plugins/duplicate-post/\" target=\"_blank\">Duplicate Post</a></p>\n<p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a href=\"https://wpml.org/documentation/theme-compatibility/\">Multilingual Ready Themes</a></li>\n<li><a href=\"https://wpml.org/documentation/plugins-compatibility/\">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you’re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href=\"https://wpml.org/documentation/theme-compatibility/go-global-program/\">go global program page</a>.</p>\n<p>In order to expedite the process, we strongly recommend that you test your theme or plugin with our <a href=\"https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/\">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin Multilingual Ready.</p>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">ThreatPress Security</h2>\n<blockquote><p>ThreatPress is a free and simple security and monitoring plugin that protects and scans your site for known malware, vulnerabilities, blacklisting, spam injections and more.</p></blockquote>\n<p style=\"text-align: center;\"><a class=\"button download-button vt-p\" href=\"https://wordpress.org/plugins/threatpress-security/\" target=\"_blank\">Download ThreatPress Security</a></p>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Enhanced Media Library</h2>\n<blockquote><p>Add media taxonomies, easily re-order media items, enhanced media shortcodes and mime types management.</p></blockquote>\n<p style=\"text-align: center;\"><a class=\"button download-button vt-p\" href=\"https://wordpress.org/plugins/enhanced-media-library/\" target=\"_blank\">Download Enhanced Media Library</a></p>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Duplicate Post</h2>\n<blockquote><p>This plugin allows users to clone posts of any type, or copy them to new drafts for further editing.</p></blockquote>\n<p style=\"text-align: center;\"><a class=\"button download-button vt-p\" href=\"https://wordpress.org/plugins/duplicate-post/\" target=\"_blank\">Download Duplicate Post</a></p>\n</div>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=WKQilMBdTOI:YWDW3pZlK5w:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=WKQilMBdTOI:YWDW3pZlK5w:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=WKQilMBdTOI:YWDW3pZlK5w:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=WKQilMBdTOI:YWDW3pZlK5w:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=WKQilMBdTOI:YWDW3pZlK5w:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=WKQilMBdTOI:YWDW3pZlK5w:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/WKQilMBdTOI\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://wpml.org/2017/08/compatible-plugins-aug-2017/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"https://wpml.org/2017/08/compatible-plugins-aug-2017/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"Meridian Linguistics and WPML join as translation partners\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpml/~3/avWxTfZlQDM/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"https://wpml.org/2017/07/meridian-linguistics-and-wpml-join-as-translation-partners/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 31 Jul 2017 14:57:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"https://wpml.org/?p=1331124/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:376:\"We are very happy to announce WPML’s latest integration with Meridian Linguistics, a fully online language services company. Meridian Linguistics is the go-to agency for difficult-to-find language pairs (e.g., Norwegian into Chinese) or high-volume rush jobs (e.g., 300,000 words of Korean into French to be completed in a month). In addition to providing over 200 [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Ornela Flores\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3476:\"<h4>We are very happy to announce <a href=\"https://wpml.org/\">WPML</a>’s latest integration with <a href=\"http://www.meridianlinguistics.com/\">Meridian Linguistics</a>, a fully online language services company.<br />\n<a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/07/wpmlmeridian.png\"><img class=\"aligncenter size-medium wp-image-1331399\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/07/wpmlmeridian-300x158.png\" alt=\"\" width=\"300\" height=\"158\" srcset=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/07/wpmlmeridian-300x158.png 300w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/07/wpmlmeridian-150x79.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/07/wpmlmeridian.png 380w\" sizes=\"(max-width: 300px) 100vw, 300px\" /></a></h4>\n<p>Meridian Linguistics is the go-to agency for difficult-to-find language pairs (e.g., Norwegian into Chinese) or high-volume rush jobs (e.g., 300,000 words of Korean into French to be completed in a month). In addition to providing over 200 languages, Meridian Linguistics is particularly well-equipped to provide translations for Asian, European, and Middle Eastern languages.</p>\n<p>Although it started as a legal specialist agency to firms such as Kobre &amp; Kim, Skadden Arps, and Herbert Smith Freehills, Meridian Linguistics has since expanded to provide translation for technology (e.g., Naver, Airbnb) and media (e.g., The Wall Street Journal, The Economist).</p>\n<p>With project managers in three time zones and 700 vetted linguists living all over the world, Meridian Linguistics believes in offering the lowest possible rates to clients and the highest pay rates to their linguists, who in turn, reward them with their loyalty and commitment.</p>\n<blockquote><p><em>&#8220;Meridian Linguistics is very excited to partner with WPML on this new integration, which will streamline the process of translating and updating websites. We know that the process of ordering and implementing website translation can be a daunting task, especially when dealing with languages a client is not familiar with. This will lessen the client&#8217;s workload while making our quality assurance procedures more efficient and affordable.&#8221;</em></p>\n<p>Sara Maria Hasbun, Managing Director of <span class=\"il\">Meridian</span> Linguistics</p></blockquote>\n<p>If you are already a WPML user and interested in using Meridian Linguistics for translation, follow the instructions for<a href=\"https://wpml.org/translation-service/meridian-linguistics/\"> translating WordPress sites with Meridian Linguistics</a>. If you are new to WPML, feel free to purchase the<a href=\"https://wpml.org/purchase/\"> Multilingual CMS</a> package and get started.</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=avWxTfZlQDM:87FAEAsFvrI:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=avWxTfZlQDM:87FAEAsFvrI:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=avWxTfZlQDM:87FAEAsFvrI:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=avWxTfZlQDM:87FAEAsFvrI:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=avWxTfZlQDM:87FAEAsFvrI:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=avWxTfZlQDM:87FAEAsFvrI:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/avWxTfZlQDM\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"https://wpml.org/2017/07/meridian-linguistics-and-wpml-join-as-translation-partners/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explic