(647559,"_transient_c3bb27d53abf5b2-update-response","O:8:\"stdClass\":9:{s:11:\"new_version\";s:5:\"5.3.3\";s:4:\"name\";s:31:\"Yoast SEO for WordPress Premium\";s:4:\"slug\";s:21:\"wordpress-seo-premium\";s:3:\"url\";s:69:\"https://my.yoast.com/?download=wordpress-seo-premium&#038;changelog=1\";s:12:\"last_updated\";s:19:\"2017-08-28 14:12:45\";s:8:\"homepage\";s:52:\"https://my.yoast.com/?download=wordpress-seo-premium\";s:7:\"package\";s:180:\"http://my.yoast.com/edd-sl/package_download/MTUwOTE2MDE4Nzo4YTc0ZjAwMmM3YmM5NjRkODEwN2MzYWZlODgzN2IyMjoxMDUyNDM6OGJkZWQxMTIxMGQ5YzVlZGZmZDBhYjI5MWNlMDkwMDg6aHR0cEAvL2Njbi1sYXcuZGV2\";s:13:\"download_link\";s:180:\"http://my.yoast.com/edd-sl/package_download/MTUwOTE2MDE4Nzo4YTc0ZjAwMmM3YmM5NjRkODEwN2MzYWZlODgzN2IyMjoxMDUyNDM6OGJkZWQxMTIxMGQ5YzVlZGZmZDBhYjI5MWNlMDkwMDg6aHR0cEAvL2Njbi1sYXcuZGV2\";s:8:\"sections\";a:2:{s:11:\"description\";s:53:\"<p>The premium version of the Yoast SEO plugin.</p>\n\";s:9:\"changelog\";s:972:\"<p>5.3.3<br />\nAugust 28th, 2017</p>\n<ul>\n<li>Fixes a bug where table listings were not giving expected content, props <a href=\"https://github.com/kjohnson\">Kyle B. Johnson</a>.</li>\n</ul>\n<p>5.3.2<br />\nAugust 23rd, 2017</p>\n<ul>\n<li>Includes every change in Yoast SEO core 5.3.2, see the <a href=\"https://wordpress.org/plugins/wordpress-seo/changelog/\">core changelog</a>.</li>\n</ul>\n<p>5.3.1<br />\nAugust 22nd, 2017</p>\n<ul>\n<li>Includes every change in Yoast SEO core 5.3.1, see the <a href=\"https://wordpress.org/plugins/wordpress-seo/changelog/\">core changelog</a>.</li>\n</ul>\n<p>5.3.0<br />\nAugust 22nd, 2017</p>\n<ul>\n<li>Add feature to export redirects, via SEO - Tools - Import/Export</li>\n<li>Removes the DC.date.issued meta tag</li>\n<li>When creating a redirect to a file, it will no longer show a warning that the target location does not exist</li>\n</ul>\n<p><a href=\"https://my.yoast.com/wordpress/plugins/seo/change-log/\">See the full changelog here</a></p>\n\";}}","no"),
